          Edit <code>src/App.tsx</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header> */}
      <main>
    <BrowserRouter>

      <Routes>
          <Route path="/" element={App}/>
          <Route path="/about" element={AboutPage}/>
          {/* <Route exact path="/cart" component={CartScreen}/> */}

        </Routes>
    </BrowserRouter>

      </main>
    </div>
  );
}

export default App;
